• challenges relating to the structure of an investment, such as governance, accountability, and decision-making conflicts that may arise in the context of a joint venture or other majority ownership investments;
• negative impact to our results of operations because of the depreciation and amortization of amounts related to acquired intangible assets, fixed assets, and deferred compensation;
• to the extent we use cash to pay for acquisitions, the commensurate limitation of other potential uses for our cash; • to the extent we incur debt to fund any acquisitions, the impact of such debt on our overall capital structure, any material restrictions thereunder on our ability to conduct our business, financial maintenance covenants and dilution to shareholders to the extent such debt instruments are convertible;

• to the extent we issue equity securities in connection with future acquisitions, existing stockholders may be diluted and earnings per share may decrease;
• additional dilution and expense associated with stock-based compensation;
• the loss of acquired unearned revenue and unbilled revenue;
• delays in customer purchases due to uncertainty related to any acquisition;
• ineffective or inadequate controls, procedures, and policies at the acquired company;
• in the case of foreign acquisitions, challenges caused by integrating operations over distance, and across different languages, cultures, and political environments;
• currency and regulatory risks associated with foreign countries and potential additional cybersecurity and compliance risks resulting from entry into new markets;
• tax effects and costs of any such acquisitions, including the related integration into our tax structure and assessment of the impact on our ability to realize our future tax assets or liabilities; and
• potential challenges by governmental authorities, including the U.S. Department of Justice (the “DOJ”), for anti-competitive or other reasons. We may also decide to restructure, divest or sell businesses, products or technologies that we have acquired or invested in. The occurrence of any of the above could have an adverse effect on our business, results of operations, financial condition and future prospects and could adversely affect the market price of our Class A Common Stock.

Our current international operations and our plans to expand our international operations could subject us to a number of risks, including:
• increased management, travel, infrastructure, and legal compliance costs associated with having multiple international operations;
• unique terms and conditions in contract negotiations imposed by clients in foreign countries;
• longer payment cycles and difficulties in enforcing contracts and collecting accounts receivable;
• the need to localize our products and services for international clients;
• changes in foreign regulatory requirements;
• increased exposure to fluctuations in currency exchange rates;
• highly inflationary international economies; • the burdens and costs of complying with a wide variety of foreign laws and legal standards relating to data security and protection of personal information, including the General Data Protection Regulation (“GDPR”) in the European Union and similar privacy regulations in the U.K. and the Asia-Pacific region;

• compliance with the U.S. Foreign Corrupt Practices Act of 1977, as amended, the U.K. Bribery Act and other anti-corruption regulations, particularly in emerging market countries;
• compliance by international staff with accounting practices generally accepted in the United States, including adherence to our accounting policies and internal controls;
• trade agreements, taxes, and other trade barriers;
• increased financial accounting and reporting burdens and complexities;
• weaker protection of intellectual property rights in some countries;
• multiple and possibly overlapping tax regimes;
• the application of the respective local laws and regulations to our business in each of the jurisdictions in which we operate;
• government sanctions that may interfere with our ability to sell into particular countries;
• disruption to our operations caused by epidemics or pandemics, such as COVID-19; and
• political, social and economic instability abroad, terrorist attacks and security concerns in general. As we continue to expand our business globally, our success will depend, in large part, on our ability to anticipate and effectively manage these and other risks associated with our international operations. Any of these risks could harm our international operations and reduce our international sales, adversely affecting our business, results of operations, financial condition, and growth prospects.

