Critical estimates in valuing certain of the intangible assets and goodwill we have acquired are:
•future expected cash flows from subscription and content contracts, other customer contracts and acquired developed technologies, and trade names;
•historical and expected customer attrition rates and anticipated growth in revenue from acquired customers;
•assumptions about the period of time the acquired trade name will continue to be used in our offerings;
•discount rates;
•uncertain tax positions and tax-related valuation allowances assumed;
•fair value of other non-cash consideration; and
•fair value of earnout consideration.
Unanticipated events and circumstances may occur that may affect the accuracy or validity of such assumptions, estimates or actual results.
Goodwill and Intangible Assets Significant judgment is required to estimate the fair value of our reporting units. Accordingly, we typically obtain the assistance of third-party valuation specialists for significant reporting units for purposes of determining whether there is goodwill impairment. The fair value estimates are based on available historical information and on future expectations. We typically estimate the fair value of these assets using the income method, which is based on the present value of estimated future cash flows attributable to the respective assets. The valuations used to establish and to test goodwill for impairment are dependent on a number of significant estimates and assumptions, including macroeconomic conditions, overall growth rates, competitive activities, cost containment and margin progression, Company business plans and the discount rate applied to cash flows.
